import React from 'react'

export default (props) => {

	const gone = {
		display: 'none'
	}

	return(
	<div className="Profile">

			<div className="Profilefoto" style={{display:'none'}}></div>

			<div className="ProfileText">
				<h2>{props.nome}</h2>
				<p>{props.text}</p>
				<br/><br/>
				<span>doe bitcoin:</span><br/>
				<span>{props.bitcoin}</span>
			</div>
	</div>
	
	)
}
